import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [email, setEmail] = useState('');
  const [name, setName] = useState('');
  const [vorname, setvorname] = useState('');
  const [geburtstag, setgeburtstag] = useState('');
  const [plz, setplz] = useState('');
  const [geschlecht, setgeschlecht] = useState('');
  const [systemrelevanz, setsystemrelevanz] = useState('');
  const [vorerkrankungen, setvorerkrankungen] = useState('');
  const [password, setPassword] = useState('');
  const [username, setUsername] = useState('');
  const [message, setMessage] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    const item = {
      "Name": "Mammadli",
      "Vorname": "Tural",
      "Mail": email,
      "Geburtstag": "27-09-1998",
      "PLZ": "91746",
      "Geschlecht": "Mann",
      "secret": password,
      "Systemrelevanz": 1,
      "Vorerkrankungen": 1
    };
    try {
      // You can replace this with your API endpoint
      const response = await axios.post('https://9xna35s7vi.execute-api.eu-central-1.amazonaws.com/dev/user/writeitem', {
        "items": [item]
    });
      setMessage('Registration successful!');
      console.log(response.data); // Optional: Log response from server
    } catch (error) {
      setMessage('Registration failed. Please try again.');
      console.error('Error:', error); // Log any errors
    }
  };

  return (
    <div className="App">
      <h1>User Registration</h1>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Email:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Password:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Username:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
        </div>
        <button type="submit">Register</button>
      </form>
      {message && <p className="message">{message}</p>}
    </div>
  );
}

export default App;
